import React from 'react';
import Content from '../Content';
import { BrowserRouter as Router, Route, Link, Redirect } from 'react-router-dom';

import { Container, Row, Col, Navbar, Nav, NavDropdown, NavItem, Form, Carousel, Image, Card, Button, p, TabPane, TabContent } from 'react-bootstrap';

// import headerImg from '../assets/images/donate-img.jpg';

class Content1 extends React.Component {
    render() {
        return (
            <Router>
                <content1>
                    <Carousel>
                        <Carousel.Item>
                            {/* <img className="d-block w-100" src="holder.js/800x400?text=First slide&bg=373940" alt="First slide"/> */}
                            <div className="w-100"></div>
                            <Carousel.Caption>
                                <h3>First slide label</h3>
                                <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                            </Carousel.Caption>
                        </Carousel.Item>
                        <Carousel.Item>
                            {/* <img className="d-block w-100" src="holder.js/800x400?text=Second slide&bg=282c34" alt="Third slide"/> */}
                            <div className="w-100"></div>
                            <Carousel.Caption>
                            <h3>Second slide label</h3>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                            </Carousel.Caption>
                        </Carousel.Item>
                        <Carousel.Item>
                            {/* <img className="d-block w-100" src="holder.js/800x400?text=Third slide&bg=20232a" alt="Third slide"/> */}
                            <div className="w-100"></div>
                            <Carousel.Caption>
                                <h3>Third slide label</h3>
                                <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                            </Carousel.Caption>
                        </Carousel.Item>
                    </Carousel>
                </content1>
            </Router>
        )
    }
}

export default Content1;
